for (int i = 0; i < n; ++i) {
if (!visited[i])
continue;
for (int j = 0; j < n; ++j) {
if (G[i][j] < 0)
continue;
int w = G[i][j] + d[i];
if (!visited[j] && w < minw) {
u = i;
v = j;
minw = w;
}
}
}
if (v < 0) {
break;
}
d[v] = minw;
visited[v] = true;
}

for (int i = 0; i < n; ++i) {
