using namespace std;

using Graph = vector<vector<int>>;
vector<bool> seen;

int dfs(const Graph &G, int v)
{
bool allComp = true;
for(auto visit:seen)
{
if(!visit) allComp = false;
}
if(allComp) return 1;

int ret = 0;
seen[v] = true;
for(auto next_v:G[v])
{
if(seen[next_v]) continue;
seen[next_v] = true;
ret += dfs(G,next_v);
seen[next_v] = false;
}
return ret;
}

int main(void)
{
int N, M;
cin >> N >> M;

Graph graph(N);
for(int i=0;i<M;i++)
{
